from typing import Optional, List, Unionfrom pydantic import BaseModelfrom datetime import datetimeclass CmsDomainPostSchema(BaseModel):    url: Optional[str] = None # domain url    path: Optional[str] = None # 페이지url    domain_type_cd: Optional[str] = None # 도메인유형코드    design_template_cd: Optional[str] = None # 디자인 템플릿    design_template_path: Optional[str] = None # 디자인 템플릿 경로    footer: Optional[str] = None # 푸터 공통 회사정보    biz_name: Optional[str] = None # 사업자명    biz_no: Optional[str] = None # 사업자번호    ceo_name: Optional[str] = None # 대표자이름    mng_name: Optional[str] = None # 담당자이름    mng_email: Optional[str] = None # 담당자이메일    phone_no: Optional[str] = None # 전화번호    addr1: Optional[str] = None # 주소1    addr2: Optional[str] = None # 주소2    memo: Optional[str] = None # 관리자메모    disp_start_dt: Optional[str] = None # 노출시작일    disp_end_dt: Optional[str] = None # 노출종료일    use_yn: Optional[str] = None # 사용여부    del_yn: Optional[str] = None # 삭제여부    reg_id: Optional[str] = None # 등록자    reg_dt: Optional[str] = None # 등록일    upd_id: Optional[str] = None # 수정자    upd_dt: Optional[str] = None # 수정일class CmsDomainSchema(CmsDomainPostSchema):    domain_id_test: Optional[str] = None # 도메인아이디    domain_name: Optional[str] = None # 도메인명class CmsDomainSearchReqSchema(BaseModel):    domain_id_test: Optional[str] = None # 도메인아이디    domain_name: Optional[str] = None # 도메인명    url: Optional[str] = None # domain url    path: Optional[str] = None # 페이지url    pageSize: Optional[int] = 100    startIndex: Optional[int] = 0class CmsDomainResSchema(CmsDomainSchema):    total_count: Optional[int] = 0              # 전체 개수